import React from 'react';
import {Ul, Img, Atag} from './components/index';
const Header = (props) => {
  return (
    <React.Fragment>
        <H1 text={<Atag link={'#'} text={<Img className={'inline-block'} src={'./logo.svg'}/>}/>}/>
      <nav>
        <Ul className={'inline-block'}/>
      </nav>
    </React.Fragment>
  );
}

export default Header;
